function update( delta ) {

	delta = 0.01;

	var targetPosition = new THREE.Vector3();


	if ( this.enabled === false ) return;

	if ( this.heightSpeed ) {

		var y = THREE.MathUtils.clamp( this.object.position.y, this.heightMin, this.heightMax );
		var heightDelta = y - this.heightMin;

		this.autoSpeedFactor = delta * ( heightDelta * this.heightCoef );

	} else {

		this.autoSpeedFactor = 0.0;

	}

	var actualMoveSpeed = delta * this.movementSpeed;

	if ( this.moveForward || ( this.autoForward && ! this.moveBackward ) ) this.object.translateZ( + ( actualMoveSpeed + this.autoSpeedFactor ) );
	if ( this.moveBackward ) this.object.translateZ( - actualMoveSpeed );

	if ( this.moveLeft ) this.object.translateX(  actualMoveSpeed );
	if ( this.moveRight ) this.translateX( - actualMoveSpeed );
	if ( this.moveUp ) this.object.translateY(  actualMoveSpeed );
	if ( this.moveDown ) this.object.translateY( -  actualMoveSpeed );

	//this.translateZ(0.001)

	var actualLookSpeed = delta * this.lookSpeed;

	if ( ! this.activeLook ) {

		actualLookSpeed = 0.0;

	}

	actualLookSpeed = 0.005;


	var verticalLookRatio = 1;

	if ( this.constrainVertical ) {
		verticalLookRatio = Math.PI / ( this.verticalMax - this.verticalMin );
	}

	lon += this.mouseX * actualLookSpeed;
	if ( this.lookVertical )  lat += this.mouseY * actualLookSpeed * verticalLookRatio;

	lat = Math.max( - 85, Math.min( 85, lat ) );
	//lon = Math.max( - 85, Math.min( 85, lon ) );	

	var phi = THREE.MathUtils.degToRad( lat );
	var theta = THREE.MathUtils.degToRad( lon );
	if ( this.constrainVertical ) {
		phi = THREE.MathUtils.mapLinear( phi, 0, Math.PI, this.verticalMin, this.verticalMax );
	}

	var position = this.position;

	targetPosition.setFromSphericalCoords( 1, Math.PI/2 + lat  , - lon ).add( position );
	this.lookAt( targetPosition );



}
